@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Message a rdfs:Class ;
    rdfs:label "Message"@en .

atm:Customer a rdfs:Class ;
    rdfs:label "Customer"@en .

atm:Bank a rdfs:Class ;
    rdfs:label "Bank"@en .

atm:callBank a rdf:Property ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Bank ;
    rdfs:label "call bank"@en .

atm:displayMessage a rdf:Property ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:Message ;
    rdfs:label "display message"@en .

atm:Message rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:displayMessage ;
    owl:someValuesFrom atm:Bank
] .

atm:Customer rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:callBank ;
    owl:someValuesFrom atm:Bank
] .
